import React from "react";
import "./Select.css";

const Select = () => {
  const data = ["one", "two", "three"];

  return (
    <div className="main">
      <input list="data" />
      <datalist id="data">
        {data.map((op) => (
          <option>{op}</option>
        ))}
      </datalist>
    </div>
  );
};

export default Select;
